import React from 'react';
import './Setting.css';
import { Link, Route, Switch, useLocation } from 'react-router-dom';

console.log("tôi là setting");
function Setting() {
    const Setting = () => {
        return (
            <>
                <div className="setting-container">

                </div>
            </>
        )
    }

    return (
        <Switch>
            <Route component={Setting} />
        </Switch>
    )



}

export default Setting;
